import { useState, useRef, useEffect } from 'react';
import { Image, Modal, Button, Slider } from 'antd';
import { CameraOutlined, PlusOutlined, MinusOutlined } from '@ant-design/icons';
import  AvatarEditor  from 'react-avatar-editor';
import './App.css';

const App = () => {
  const [imageOriginal, setImageOriginal] = useState();
  const [imageUrl, setImageUrl] = useState();
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [scaleOriginal, setScaleOriginal] = useState();
  const [selectedFile, setSelectedFile] = useState();
  const [avatarFile, setAvatarFile] = useState();
  const [loading, setLoading] = useState(false);
  const [scale, setScale] = useState();
  const [positionOriginal, setPositionOriginal] = useState();
  const [position, setPosition] = useState();
  const [prev, setPrev] = useState(true);
  const [next, setNext] = useState(false);
  const editor = useRef(null);

  useEffect(() => {
    setImageOriginal('data:image/png;base64,');
    setScaleOriginal(1);
    setPositionOriginal({x:0,y:0});
  }, []);

  useEffect(() => {
    setImageUrl(imageOriginal);
  }, [imageOriginal]);

  useEffect(() => {
    setScale(scaleOriginal);
  }, [scaleOriginal]);
  
  useEffect(() => {
    setPosition(positionOriginal);
  }, [positionOriginal]);

  useEffect(() => {
    setPrev(false);
    setNext(false);
    if (scale <= 1) {
      setPrev(true);
    }
    if (scale >= 3) {
      setNext(true);
    }
  }, [scale]);

  const sendDataToDB = async () => {
    const data = {
      originalFile : selectedFile,
      avatarFile : avatarFile,
      position : position,
      scale : scale
    }

    console.log(data);
  };
  
  const handleOk = async () => {
    setLoading(true);
    const dataUrl = editor.current.getImage().toDataURL();
    const result = await fetch(dataUrl);
    const blob = await result.blob();
    setScaleOriginal(scale);
    setPositionOriginal(position);
    setAvatarFile(blob);
    setImageUrl(dataUrl);
    setIsModalOpen(false);
    await sendDataToDB();
    setLoading(false);
  };

  const handleCancel = () => {
    setScale(scaleOriginal);
    setPosition(positionOriginal);
    setIsModalOpen(false);
  };

  const openModal = () => {
    setIsModalOpen(true);
  };

  const triggerUpload = () => {
    document.getElementById("upload-icon").click();
  };

  const minusScale = () => {
    setScale(scale - 0.1);
  };

  const plusScale = () => {
    setScale(scale + 0.1);
  };

  const onFileChange = event => {
    if (event.target.files[0]) {
      setSelectedFile(event.target.files[0]);
      setScale(1);
      const reader = new FileReader();
      reader.readAsDataURL(event.target.files[0]);
      reader.addEventListener('load', () => {
        setImageOriginal(reader.result);
        setIsModalOpen(true);
      });
    }
  };

  return (
    <div className="main">
      <input type="file" onChange={onFileChange} id="upload-icon" />
      <span>
        <Image
          width={200}
          rootClassName="image-round"
          src={imageUrl}
        />
        <Button className='edit-profile-btn' shape="circle" icon={<CameraOutlined />} onClick={openModal}/>
      </span>

      <Modal 
        title="Change Profile Picture" 
        open={isModalOpen} 
        onOk={handleOk} 
        onCancel={handleCancel}
        footer={[
          <Button onClick={triggerUpload} className="upload-image-btn">Upload Image</Button>,
          <Button key="back" onClick={handleCancel}>
            Cancel
          </Button>,
          <Button key="submit" type="primary" loading={loading} onClick={handleOk}>
            Save
          </Button>,
        ]}>
        <div className="photo-editor">
          <AvatarEditor
            ref={editor}
            image={imageOriginal}
            width={250}
            height={250}
            borderRadius={125}
            border={[135, 30]}
            color={[30, 30, 30, 0.8]}
            position={position}
            onPositionChange={setPosition}
            scale={scale}
            rotate={0}
            backgroundColor="white" />
        </div>
        <div className="slider-setting">
          <div className="slider-button">
            <Button 
              type="link" 
              shape="circle" 
              icon={<MinusOutlined />} 
              onClick={minusScale} 
              disabled={prev} />
          </div>
          <div className="slider-track">
            <Slider
              min={1}
              max={3}
              onChange={setScale}
              step={0.1}
              value={typeof scale === 'number' ? scale : 1}
            />
          </div>
          <div className="slider-button">
            <Button 
              type="link" 
              shape="circle" 
              icon={<PlusOutlined />} 
              onClick={plusScale} 
              disabled={next} />
          </div>
        </div>
      </Modal>
    </div>
  );
}

export default App;
